import React from "react";
import classes from "./NewsBar.module.css";
const NewsBar = (props) => {
  const { image, newsTitle, newsHeading, newsPara } = props;
  return (
    <div className={classes.NewsBar}>
      <div>
        <img src={image} alt="" />
        <h3>{newsTitle}</h3>
        <h2>{newsHeading}</h2>
        <p>{newsPara}</p>
      </div>
    </div>
  );
};

export default NewsBar;
